import React from 'react'
import { BrowserRouter as Link } from 'react-router-dom'

const Blog = ({ blog, ...props }) => {

    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }

    return(
        <li>
            <Link to={`/blogs/${blog.id}`}>{blog.title}</Link>
        </li>
    )
}


export default Blog
